import React, { Component } from 'react';

class Points extends Component {

    getAllPlayersFromCookies = () => {
        document.cookie.substring(document.cookie.indexOf(";")+1).split("|")
    }

    render() {
        return (
            <div> {console.log(this.getAllPlayersFromCookies)} </div>
        )
    }
}

export default Points;
